SUPER SIMPLE DRUGSTORE HALLOWEEN LOOK! I did this whole look using ONLY MAKEUP PRODUCTS that you can buy from @USERNAME_HERE & @USERNAME_HERE !! I'll show you how on my YouTube channel tomorrow, for now I'll just leave you a list of products used:
@USERNAME_HERE matte finish foundation (you can use your own shade or go 1 or 2 lighter if you want it to look more ghostly!)
@USERNAME_HERE sfx ghost contour stick (which is like black and white cream makeup) and ghost palette (which is black and white powder product and some shimmery cream products too)
@USERNAME_HERE awesome double flick liquid eyeliner pen
@USERNAME_HERE retractable eyeliner pencil in black and liquid suede lipstick in pink lust, and my usual mascara (big and loud lash primer and curvaceous mascara)
Oh, and a bit of strobing stick and matte finish setting spray by @USERNAME_HERE 
THATS IT!! And the method is CRAZY SIMPLE! Make sure you're subscribed to my YouTube channel and I'll PROVE how easy this is! The channel link is in my Instagram bio!

Gonna call it a day on this one. 
